// SPDX-License-Identifier: MIT
pragma solidity ^0.8.5;

import "@openzeppelin/contracts/access/AccessControl.sol";

/**
 * @title Governance contract
 */
contract Governance is AccessControl {
    bytes32 public constant ADMIN = keccak256("ADMIN");
    uint256 private podVotingPeriod;

    mapping(address => bool) public assetWhitelisted;

    event AssetWhitelisted(address _asset, bool _whitelisted);

    constructor(uint256 _podVotingPeriod) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);

        podVotingPeriod = _podVotingPeriod;
    }

    function getPodVotingPeriod() external view returns (uint256) {
        return podVotingPeriod;
    }

    function setPodVotingPeriod(uint256 _podVotingPeriod) external onlyRole(ADMIN) {
        podVotingPeriod = _podVotingPeriod;
    }

    function whitelistAsset(address asset) external onlyRole(ADMIN) {
        require(asset != address(0), "asset token address cannot be 0");
        require(!assetWhitelisted[asset], "already whitelisted");

        emit AssetWhitelisted(asset, true);

        assetWhitelisted[asset] = true;
    }
}
